// BZHI performs "Zero High Bits Starting with Specified Bit Position".
//
// Mnemonic        : BZHI
// ISA extensions  : BMI2
// Supported forms : (4 forms)
//
//    * BZHI r32, r32, r32
//    * BZHI r32, m32, r32
//    * BZHI r64, r64, r64
